##################################################################
data_path = r'D:/railyway/文章二/search_festener/cluster.txt'
idx_path = r'D:/railyway/文章二/search_festener/mag_idx.txt'
search_bin = np.arange(10, 14)
angel_bin = np.arange(-30, 40, 10)

##################################################################
# 读取TXT文件并将其转换为NumPy数组
with open(data_path, 'r') as file:
    data = []
    for line in file:
        # 使用split()函数以制表符('\t')或其他分隔符分割每一行，并将其转换为浮点数列表
        line = list(map(float, line.strip().split('\t')))
        data.append(line)
    # 将数据列表转换为NumPy数组
    data_cluster = np.array(data)
#读取每一行数据fft结果最大值对应的索引
with open(idx_path, 'r') as file1:
    idx = []
    line = list(map(int, file1.readline().strip().split('\t')))
    idx.append(line)
    # 将数据列表转换为NumPy数组
    idx_cluster = np.array(idx).ravel()
##################################################################
distance = []
for i in range(data_cluster.shape[0]):
    # #归一化
    min_val = np.min(data_cluster[i, :])
    max_val = np.max(data_cluster[i, :])
    data_cluster[i, :] = (data_cluster[i, :] - min_val) / (max_val - min_val)
    #对每个单元的数据进行聚类
    n_clusters = idx_cluster[i]
    ms = KMeans(n_clusters=n_clusters)
    x_axis = np.arange(0, data_cluster.shape[1]*1e0, 1e0)
    y_axis = data_cluster[i, :]
    cluster_fit = np.vstack((x_axis, y_axis)).transpose()
    ms.fit(cluster_fit)
    labels = ms.labels_
    cluster_centers = ms.cluster_centers_
    # 结果画图
    unique_labels = np.unique(labels)
    colors = plt.cm.viridis(np.linspace(0, 1, len(unique_labels)))
    plt.figure()
    for label, color in zip(unique_labels, colors):# 获取当前类别的所有点
        points = cluster_fit[labels == label]
        # 使用 plt.plot 绘制连接点的曲线
        plt.plot(points[:, 0]/5000, points[:, 1], c=color, lw=2)
    # plt.figure()
    # plt.plot(cluster_fit[:, 0], cluster_fit[:, 1])
    # plt.scatter(cluster_fit[:, 0], cluster_fit[:, 1], c=labels, cmap='viridis', s=50, alpha=0.5)
    # plt.scatter(cluster_centers[:, 0], cluster_centers[:, 1], c='black', marker='x', s=100, linewidths=5)
    plt.title(f'KMeans Clustering (Estimated number of clusters: {n_clusters})')
    plt.xlabel('x')
    plt.ylabel('y')
    plt.grid(True)
    # 将分段数据放在signal_segment中
    signal_data = data_cluster[i, :]
    signal_segment = []
    len_max = 0
    for j in range(n_clusters):
        indexes = np.array(np.where(labels == j))
        len_max_temp = indexes.size
        if len_max_temp > len_max:
            len_max = len_max_temp
        signal_segment.append(signal_data[indexes.ravel()])
    signal_segment = np.array(signal_segment, dtype=object)
    #获取模板
    signal_segment_new = []
    for j in range(n_clusters):
        # 创建插值函数
        interpolation_func = interp1d(np.arange(len(signal_segment[j])), signal_segment[j], kind='cubic')
        # 插值得到长度为len_max的新信号
        signal_segment_new.append( interpolation_func(np.linspace(0, len(signal_segment[j]) - 1, num=len_max)) )
    signal_segment_new = np.array(signal_segment_new, dtype=float)
    Template = np.mean(signal_segment_new, axis=0)
    #求DTW
    sum_distance = 0
    sum_count = 0
    for j in range(n_clusters):
        temp_distance, temp_path = dtw(Template, signal_segment[j])
        sum_distance += temp_distance
        sum_count += 1
    distance.append(sum_distance / sum_count)
distance = np.array(distance).reshape(search_bin.size, angel_bin.size)
print(distance)
